import React from 'react';
import Title from './Home/Title';
import Logo from './Home/Logo';
import PlayBtn from './Home/PlayBtn';
import NickName from './Home/NickName';
import ChooseTheme from './Home/ChooseTheme';
import RulesBtn from './Home/RulesBtn';

class Home extends React.Component {
  goToPlaylist(idPlaylist) {
    this.setState({
      idSongs: idPlaylist
    });
  }

  render() {
    return (
      <div>
        <RulesBtn />
        <Title />
        <Logo />
        <NickName />
        <ChooseTheme parentMethodChoosePlaylist={this.goToPlaylist} />
        <PlayBtn />
      </div>
    );
  }
}

export default Home;
